    alignItems: "center",
    display: "flex",
    width: 311,
    color: Color.othersWhite,
    fontFamily: FontFamily.robotoBold,
    fontWeight: "700",
    left: 32,
  },
  ovalIcon: {
    left: 32,
  },
  ovalCopyIcon: {
    left: 52,
  },
  ovalCopy2: {
    left: 72,
  },
  rectangleCopy3: {
    borderRadius: Border.br_5xl,
    backgroundColor: Color.colorRoyalblue,
    left: 0,
    height: 48,
    top: 0,
  },
  rectangleCopy3Wrapper: {
    left: 0,
    height: 48,
    top: 0,
  },
  signInWith: {
    top: 16,
